import React from 'react'
import PropTypes from 'prop-types';

export default function Header(props) {
  return (
    <div>
        { searchBar ? <h1>
            {props.title}
        </h1>
        : "No Search Bar"}
    </div>
  )
}

Header.defaultProps = {
    title : "Your Title Here",
    searchBar : true
}

Header.propTypes = {
    title : PropTypes.string,
    searchBar : PropTypes.bool
}
